import IUnitInfo from "../../interface/IUnitInfo";
import DefaultStrategy from "../unitStrategy/DefaultStrategy";
import ArcherStrategy from "../unitStrategy/MageStrategy";
export default class ElfArcherUnitInfo extends DefaultStrategy
  implements IUnitInfo {
  _unitType: string;
  _HP: number;
  _damage: number;
  _initiative: number;
  _actionType: void;
  constructor() {
    super(new ArcherStrategy());
    this._unitType = "range";
    this._HP = 90;
    this._damage = 40;
    this._initiative = 60;
  }
}
